import React from 'react';
import'./EventList.css';

const EventList = () => {
  const events = [
    { name: 'Media Expo', id: 1 },
    { name: 'Print Expo Chennai', id: 2 },
  ];

  return (
    <div className="event-list">
      <h2>Create new event - Events</h2>
      <button>Create new Event</button>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {events.map((event) => (
            <tr key={event.id}>
              <td>{event.name}</td>
              <td>
                <button>Edit</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default EventList;
